import React from 'react';

const Leading = () => {
    return (
        <div className="connect-container mt-4 text-center">
            <h3 className="py-4 fw-bold text-uppercase text-white">Leading <br /> Companies <br /> start <br /> Here</h3>
            <div className="text-white d-flex justify-content-evenly align-items-center px-3">
                <p>
                    our partnership with pioneers  of networking infrastructure
                    makes our resources highly trustworthy
              </p>
            </div>
            <button className="btn font-size-small yellow rounded-0 text-white">Learn More</button>
        </div>
    )
}

export default Leading;
